		background-image: none !important;
	}
}

iframe {
    height: 60%
}

  #perguntas div {
    border-radius: 15px;
  }

  body::-webkit-scrollbar {
    /* :tamanho da barra de rolagem */
    width: 0.25rem;
  }

  body::-webkit-scrollbar-track {
    /* :cor de fundo da barra de rolagem */
    background: #fff;
  }

  body::-webkit-scrollbar-thumb {
    /* :mudando a cor da barra de rolagem de dentro */
    background: var(--e-global-color-primary);
  }

  body {
    overflow-x: hidden;
  }

  @media (max-width: 768px) {
    body,
    html {
      overflow-x: hidden !important;
    }
  }

  @media (max-width: 1024px) and (min-width: 769px) {
    body,
    html {
      overflow-x: hidden;
    }
  }

  #whatsapp {
    position: fixed;
    right: 20px;
    bottom: 20px;
    z-index: 9999;
    transition: 1s;
  }

  @media (max-width: 768px) {
    #whatsapp {
      right: 10px;
      bottom: 10px;
    }
  }

  .site {
    hyphens: none !important;
  }

    * {
        box-sizing: border-box;
    }

    .in {
        display: block !important;
    }

    .formlead-container {
        display: none;
        transform-origin: 50% 50% 0;
        transition: transform .2s;
        position: fixed;
        bottom: 100px;
        width: 400px;
        top: 20px;
        background: white;
        border-radius: 5px;
        box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.51);
        -webkit-box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.51);
        -moz-box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.51);
        z-index: 99999999;
    }

    .formlead-container.left {
        left: 20px;
    }

    .formlead-container.right {
        right: 20px;
    }

    .formlead-container .heading .controls {
        text-align: right;
        position: absolute;
        right: 0;
    }

    .formlead-container .heading svg {
        margin: 10px 20px 0;
        background: #7b7a7a;
        padding: 2px;
        border-radius: 5px;
    }

    .formlead-container .heading .information {
        background: #cccccc;
        text-align: center;
        display: flex;
        flex-direction: column;
    }

    .formlead-container .heading .information img {
        height: 100px;
        margin: 10px auto 10px;
    }
    .formlead-container .heading .information .img {
        display: flex;
        justify-content: center;
        align-items: center;
    }

    .formlead-container .heading .alerta {
        padding-top: 20px;
        text-align: center;
        color: #929292;
    }

    .formlead-container.show {
        display: inline;
        transform-origin: 50% 50% 0;
        transition: transform .2s;
    }

    .formlead-container form {
        padding: 40px 20px;
        display: flex;
        flex-direction: column;
        gap: 15px;
    }

    .formlead-container form .containerPhone {
        position: relative;
    }
    #fields {
        display: flex;
        flex-direction: column;
        gap: 10px;
    }
    .formlead-container form input,
    .formlead-container form select {
        width: 100%;
        border: none;
      	border-radius: 10px;
        background: rgb(255, 255, 255);
        box-shadow: 0px 0px 6px 0px #d2d2d2;
    }

    .formlead-container form select {
        height: 38px;
    }

    .formlead-container button {
        border: none;
        padding: 15px 10px;
        width: 100%;
        text-transform: uppercase;
        color: white;
        font-weight: bold;
        background: #25d366;
        margin-top: 20px;
        border-radius: 5px;
        line-height: unset;
    }

    .formlead-container button:hover {
        cursor: pointer;
        background: #10ab4a;
    }

    #element-513 img {
        cursor: pointer;
    }

    .formlead-toolbar {
        position: fixed;
        bottom: 20px;
        z-index: 99;
    }

    .formlead-toolbar.left {
        left: 20px;
    }

    .formlead-toolbar.right {
        right: 20px;
    }

    .formlead-toolbar a.whatsapp-link {
        width: 50px;
        height: 50px;
        padding: 13px;
        display: block;
        color: #fff;
        background: #25d366;
        -webkit-border-radius: 50%;
        -moz-border-radius: 50%;
        border-radius: 50%;
        box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.51);
        -webkit-box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.51);
        -moz-box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.51);
        transform-origin: 50% 50% 0;
        transition: transform .2s;
        -webkit-touch-callout: none;
        -webkit-user-select: none;
        -khtml-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
        line-height: 1;
    }

    .formlead-toolbar a.whatsapp-link:hover {
        transform: scale(1.1);
        transform-origin: 50% 50% 0;
        transition: transform .2s;
    }

    .formlead-toolbar a.whatsapp-link img {
        width: 100%;
    }

    /* Mobile */

    @media only screen and (max-width: 1200px) {}

    @media only screen and (max-width: 992px) {}

    @media only screen and (max-width: 768px) {
        .formlead-container {
            width: 95% !important;
            left: 2%;
        }
    }

    @media only screen and (max-width: 480px) {
        .formlead-container {
            bottom: 10px !important;
            height: 98vh;
        }
    }

    @media only screen and (max-width: 320px) {}

    #modal-container {
        display: none;
        position: fixed;
        bottom: 70px;
        background: #fff;
        z-index: 2;
        width: max-content;
        padding: 20px;
        border-radius: 19px 19px 19px 0;
        width: max-content;
        border: 3px solid #25d366;
    }
    #modal-container.left {
        left: 20px;
    }
    #modal-container.right {
        right: 20px;
    }
    #modal-container .modalTitle {
        font-weight: bold;
    }
    #modal-container .modal li {
        padding: 5px 0;
        width: 100%;
    }
    #modal-container .modal-background .modal #units_select a {
        cursor: pointer;
        outline: none;
        color: #fff;
        padding: 5px 10px;
        border-radius: 6px;
        background: rgba(27,177,62,1);
        transition: all ease-in-out .5s;
        width: auto;
        display: flex;
        justify-content: flex-start;
        align-items: center;
        gap: 10px;
    }
    #modal-container .modal-background .modal #units_select a img {
        width: 16px;
    }
    #modal-container .modal-background .modal #units_select a:hover {
        background: #128c7e;
        transition: all ease-in-out .5s;
    }
    #modal-container .modal {
        display: flex;
        flex-direction: column;
        gap: 15px;
    }
    #units_select {
        display: flex;
        flex-direction: column;
        gap: 10px 0;
    }
    .formlead-toolbar.whats-in a.whatsapp-link {
        border-radius: 0 0 50% 50%;
        box-shadow: 0px 16px 14px 0 rgba(0, 0, 0, 0.51);
    }

